import React, { Component } from "react";
import {
  Radar,
  RadarChart,
  PolarGrid,
  PolarAngleAxis,
  PolarRadiusAxis,
  Legend
} from "recharts";

class DOA extends Component {
  state = {
    chart: {}
  };
  constructor(props) {
    super(props);
    this.state.chart = { msg: "test chart", osX: [], osY: [] };
  }

  render() {
    const data = [
      {
        subject: "Math",
        A: 120,
        B: 110,
        fullMark: 150
      },
      {
        subject: "Chinese",
        A: 98,
        B: 130,
        fullMark: 150
      },
      {
        subject: "English",
        A: 86,
        B: 130,
        fullMark: 150
      },
      {
        subject: "Geography",
        A: 99,
        B: 100,
        fullMark: 150
      },
      {
        subject: "Physics",
        A: 85,
        B: 90,
        fullMark: 150
      },
      {
        subject: "History",
        A: 65,
        B: 85,
        fullMark: 150
      }
    ];
    return (
      <div>
        <ScatterChart
          width={400}
          height={400}
          margin={{
            top: 20,
            right: 20,
            bottom: 20,
            left: 20
          }}
        >
          <CartesianGrid />
          <XAxis type="number" dataKey="x" name="stature" unit="cm" />
          <YAxis type="number" dataKey="y" name="weight" unit="kg" />
          <Tooltip cursor={{ strokeDasharray: "3 3" }} />
          <Scatter name="A school" data={data} fill="#8884d8" />
        </ScatterChart>
      </div>
    );
  }
}

export default DOA;
